export const styles = theme => ({
    root: {
        marginLeft: "14px",
        width: "calc(100% - 28px)",
    },
    thumb: {
        height: "26px",
        marginLeft: "-13px",
        marginTop: "-13px",
        width: "26px",
    },
    textContainer: {
        display: "flex",
        justifyContent: "space-between",
        marginBottom: theme.spacing(2),
    },
    valueLabel: { color: theme.palette.hotel.main },
});
